import React from 'react';
import '../App.css';
import { Button } from './Button';
import './HeroSection.css';

function HeroSection() {

  const signup = () => {
    window.location.href = 'https://docs.google.com/spreadsheets/d/1YuzBM5KBdwxv-IPzfpTOIvmTidpL37fYNjkDT_su4u0/edit#gid=0'; // Replace 'https://www.example.com' with the desired URL
  };

  return (
    <div className='hero-container'>
      <video src='/videos/video-1.mp4' autoPlay loop muted />
      <h1>FOOD RECOVERY NETWORK AT BROWN</h1>
      <p>Fight waste. Feed people.</p>
      <div className='hero-btns'>
        <Button
         className='btns'
         buttonStyle='btn--outline'
         buttonSize='btn--large'
         onClick={signup} // Add onClick event handler
       >
          JOIN OUR TEAM
        </Button>
       <Button
         className='btns'
         buttonStyle='btn--outline'
         buttonSize='btn--large'
         onClick={signup} // Add onClick event handler
       >
          JOIN OUR SLACK
        </Button>
      </div>
    </div>
  );
}

export default HeroSection;
